// @flow

import classNames from 'classnames';
import React, { Component } from 'react';
import { connect } from 'react-redux';
import Head from 'next/head';
import Error from './pages/Error';
import { logError } from '../utils/rollbar-client';

import type { Node } from 'react';
import type { State } from 'shared/types/state';
import type { Action, Dispatch } from 'shared/types/actions';
import type { ComponentError } from 'shared/types/error';

type Props = {
  jsReady: boolean,
  children: Node,
  jsLoad: () => Action
};

type LocalState = {
  error: ?ComponentError
};

class Layout extends Component<Props, LocalState> {
  state = {
    error: null
  };

  componentDidMount() {
    const { jsReady, jsLoad } = this.props;

    if (!jsReady) {
      jsLoad();
    }
  }

  componentDidCatch(error, { componentStack }) {
    logError(error);

    this.setState({
      error: {
        message: error.toString(),
        stack: componentStack
      }
    });
  }

  render() {
    const { jsReady, children } = this.props;
    const { error } = this.state;

    const layoutClasses = classNames('layout', {
      'layout-static': !jsReady
    });

    return (
      <div>
        <Head>
          <meta charSet="utf-8" />
          <meta name="description" content="A fast-paced two-player web game" />
          <meta
            name="viewport"
            content="width=device-width, initial-scale=1, minimum-scale=1, maximum-scale=1, user-scalable=no"
          />
          <meta name="apple-mobile-web-app-capable" content="yes" />
          <meta
            name="apple-mobile-web-app-status-bar-style"
            content="default"
          />
          <meta name="theme-color" content="#34495f" />
          <link rel="manifest" href="/static/manifest.webmanifest" />
          <link
            rel="icon"
            type="image/png"
            sizes="16x16"
            href="/static/favicon-16x16.png"
          />
          <link
            rel="icon"
            type="image/png"
            sizes="32x32"
            href="/static/favicon-32x32.png"
          />
          <link
            rel="icon"
            type="image/png"
            sizes="192x192"
            href="/static/android-chrome-192x192.png"
          />
          <link
            rel="icon"
            type="image/png"
            sizes="256x256"
            href="/static/android-chrome-256x256.png"
          />
          <link
            rel="apple-touch-icon"
            sizes="180x180"
            href="/static/apple-touch-icon.png"
          />
        </Head>
        <style jsx global>{`
          html,
          body {
            margin: 0;
            padding: 0;
            font-family: -apple-system, BlinkMacSystemFont, Ubuntu,
              'Helvetica Neue', sans-serif;
            font-size: 16px;
            background: #fff;
          }

          @font-face {
            font-family: 'Teko';
            font-style: normal;
            font-weight: 300;
            src: local('Teko Light'), local('Teko-Light'),
              url('data:application/x-font-ttf;charset=utf-8;base64,')
                format('truetype');
          }
          @font-face {
            font-family: 'Teko';
            font-style: normal;
            font-weight: 400;
            src: local('Teko Regular'), local('Teko-Regular'),
              url('data:application/x-font-ttf;charset=utf-8;base64,')
                format('truetype');
          }
        `}</style>
        <div className={layoutClasses}>
          {error ? <Error error={error} /> : children}
        </div>
        <style jsx>{`
          .layout {
            transition: filter 1s;
          }
          .layout-static {
            filter: grayscale(100%);
          }
        `}</style>
      </div>
    );
  }
}

function mapStateToProps({ jsReady }: State): $Shape<Props> {
  return { jsReady };
}

function mapDispatchToProps(dispatch: Dispatch): $Shape<Props> {
  return {
    jsLoad: () => dispatch({ type: 'JS_LOAD' })
  };
}

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(Layout);
